import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import MoodConnection from '../components/MoodConnection';

const MoodConnectionPage = () => {
  return (
    <>
      <Header />
      <MoodConnection />
      <Footer />
    </>
  );
};

export default MoodConnectionPage;
